import React from "react";
import { Link } from "react-router-dom";
const url = "https://i.etsystatic.com/30791951/r/il/dcd9c4/3442146427/il_1588xN.3442146427_lb34.jpg"
const Navbar = () => {
    return(
        <>
    <div className = "nav">
         <Link to = "/"><img src = {url} alt = "Logo" className = "logo" /></Link>
         <Link to = "/photogrid" className = "menu lavori"> I nostri lavori </Link>
         <Link to = "/where" className = "menu dove"> Dove siamo </Link>
    </div>
    <div className = "cont">

         <Link to = "/contact"> <h5 className = "disclaimer" > CONTATTACI PER IL TUO MATRIMONIO </h5> </Link>
    </div>
    </>
    )
}

export default Navbar;
